use etlkioskops;

SELECT c.name AS ColumnName
	,t.Name AS DataType
	,c.max_length AS Length
	,c.precision
	,c.scale
	,c.is_nullable
	,ISNULL(i.is_primary_key, 0) 'Primary Key'
	,COLUMNPROPERTY(c.object_id, c.name, 'IsIdentity') AS IdFlag
FROM sys.columns c
INNER JOIN sys.types t ON c.user_type_id = t.user_type_id
LEFT OUTER JOIN sys.index_columns ic ON ic.object_id = c.object_id
	AND ic.column_id = c.column_id
LEFT OUTER JOIN sys.indexes i ON ic.object_id = i.object_id
	AND ic.index_id = i.index_id
WHERE c.object_id = OBJECT_ID('vRetailSession')
	AND COLUMNPROPERTY(c.object_id, c.name, 'IsIdentity') = 0

